import React from 'react';
import { createMaterialBottomTabNavigator } from '@react-navigation/material-bottom-tabs';
import { StyleSheet, Text, View, Button } from 'react-native';

// Import your screen components with the correct paths
import ProfileScreen from './screens/profile';
import DashboardScreen from './screens/dashboard';

const Tab = createMaterialBottomTabNavigator();

function MyTabs() {
  return (
    <Tab.Navigator>
      <Tab.Screen name="Dashboard" component={DashboardScreen} />
      <Tab.Screen name="Profile" component={ProfileScreen} />
    </Tab.Navigator>
  );
}

export default function HomeScreen({ navigation }) {
  return (
    <View style={styles.container}>
      <Text style={styles.labelStyle}>Welcome to Skai Hub</Text>
      <View style={styles.buttonContainer}>
        <Button title="Call Dashboard" onPress={() => navigation.navigate('Dashboard')} />
        <Button title="Call Profile" onPress={() => navigation.navigate('Profile')} />
        <MyTabs />
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  labelStyle: {
    marginBottom: 20,
    fontWeight: 'bold',
    fontSize: 24,
  },
  buttonContainer: {
    marginTop: 10,
    flexDirection: 'row',
    justifyContent: 'space-around',
    width: '80%',
  },
});
